import React from "react";

import "./page.css";

export const Mypage = () =>{
  const [isHovering, setIsHovering] = useState(0);
    return(
        <div>
          <ul className='mypage'>
            <li onMouseOver={() => setIsHovering(1)}
                onMouseOut={() => setIsHovering(0)}
            >

            </li>
          </ul>
        </div>
    )
}
